import React from 'react';
import { Route, Switch} from "react-router-dom";
import './styles/App.css';
import Home from './page/Home';
import CV from './page/Cv';
import About from './page/About';
import Contact from './page/Contact';
import NotFound from "./page/NotFound";
import Cv_Home from './page/cv/Home_Cv';
import Contact_CV from './page/cv/Contact_CV';
import Portfolio from './page/cv/Portfolio';
import Knowledge from './page/cv/Knowledge';
import Login from './components/connexion/Login';
import Singup from './components/connexion/SingUp';
import {PrivateRoute } from './components/PrivateRoute/PrivateRoute';

function App() {
  return (
    <>
      <Switch>
      <Route exact path="/login" component={Login} />
      <Route exact path="/singup"  component={Singup}/>
      <PrivateRoute exact path="/"  component={Home} />
      <PrivateRoute exact path="/cv"  component={CV} />
      <PrivateRoute exact path="/about"  component={About} />
      <PrivateRoute exact path="/contact"  component={Contact} />
      <PrivateRoute exact path="/cv/home"  component={Cv_Home} />
      <PrivateRoute exact path="/cv/contact_cv"  component={Contact_CV} />
      <PrivateRoute exact path="/cv/portfolio"  component={Portfolio} />
      <PrivateRoute exact path="/cv/knowledge"  component={Knowledge} />
      <Route component={NotFound} />
      </Switch>
    </>
  );
}
export default App;
